import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import barba from '@barba/core';




ReactDOM.render(

  <React.StrictMode>
    barba.init({
      <App />
    });
  </React.StrictMode>,
  document.getElementById('root')
);
